struct HeadTail
{
	HeadTail(const char* h, const char* t)
		: head(h)
		, tail(t)
	{
	}
	const char* const head;
	const char* tail;
};

class MyLess
{
public:
	bool operator() (const HeadTail* p1, const HeadTail* p2) const
	{
		return strcmp(p1->head, p2->head) < 0;
	}
};

typedef std::set<HeadTail*, MyLess> HeadTailSet;

std::string getNext(HeadTailSet& hts, const char* tail)
{
	std::string min;
	for (auto& x : hts)
	{
		if (x->tail <= tail)
		{
			min.assign(x->head, x->tail);
			x->tail++;
			break;
		}
	}
	return min;
}

char getLetter(const std::string& text, unsigned int k)
{
	std::map<char, HeadTailSet> substringy;
	auto cleanSubstringy = [&substringy] ()
	{
		for (auto& x : substringy)
		{
			for (auto y : x.second)
			{
				delete y;
			}
		}
	};

	const char* head = text.c_str();
	const char* tail = head + text.length();
	while (*head)
	{
		substringy[*head].insert(new HeadTail(head, head + 1));
		head++;
	}

	for (auto& x : substringy)
	{
		auto& y = x.second;
		auto prev = y.begin();
		auto it = prev;
		it++;
		for (; it != y.end(); it++)
		{
			const char* prevHead = (*prev)->head;
			const char* nextHead = (*it)->head;
			while (*prevHead)
			{
				if (*prevHead == *nextHead)
				{
					prevHead++;
					nextHead++;
					(*it)->tail++;
				}
				else
				{
					break;
				}
			}
			prev = it;
		}
	}

	for (auto& x : substringy)
	{
		std::string next;
		std::string prev;
		do
		{
			next = getNext(x.second, tail);
			if (next != prev)
			{
				if (k < next.size())
				{
					cleanSubstringy();
					return next.at(k);
				}
				else
				{
					k -= next.size();
				}
				prev = next;
			}
		} while (next.length() > 0);
	}

	cleanSubstringy();
	return -1;
}


